/*  METHOD 2 */

// This method 2 working for small test cases like:

/*

Example 1:

Input: nums = [4,3,2,7,8,2,3,1]
Output: [2,3]
Example 2:

Input: nums = [1,1,2]
Output: [1]
Example 3:

Input: nums = [1]
Output: []
*/

var findDuplicates = function (nums) {
    let duplicateArray = [];
    let s = 0;
    for (let i = 1; i < nums.length; i++) {
        if (nums[s] === nums[i]) {
            duplicateArray.push(nums[s]);
            i = ++s;
        }
        if (i == nums.length - 1) {
            i = ++s;
        }
    }
    return duplicateArray;
}
